					<h1>Устройство проема в кирпичной стене с усилением</h1>
									<p>Московская область, Щелковский район, г. Фрязино </p>

<p>Задача: устройство проема в кирпичной стене толщиной 180мм с усилением для проезда погрузочного транспорта в производственном помещении.</p>

<p>Сложность проекта заключалась в устройстве нестандартного усиления, связанного с 10 метровой высотой стены и попадающей в проем стойкой усиления (устанавливалась при возведении стены).</p>

<p>Был принято наиболее оптимальное проектное решение. В первую очередь было выполнено усиление, а вслед за ним и сам демонтаж смены. Резка кирпича производилась ручными резчиками Husqvarna.</p>

<p>Работы производились круглосуточно и были выполнены раньше оговоренного срока.</p>
